@AccessControl.authorizationCheck: #NOT_REQUIRED
@EndUserText.label: 'Interface View - Consignment'
@Metadata.allowExtensions: true
define root view entity ZPR_I_CONSIGNMENT 

as select from I_SupCsgnmtPplineWthdrwlAPI01 as cons
association [0..1] to ZPR_I_MATERIAL   as _Mat        on $projection.Material  = _Mat.Material
                                                        and _Mat.Language = $session.system_language
association [0..1] to I_Plant           as _Plant   on  $projection.Plant = _Plant.Plant                                                        
association [0..1] to I_UnitOfMeasure  as _UoM        on $projection.QtyUnit = _UoM.UnitOfMeasure                                                        
association [0..1] to I_Currency       as _Currency   on $projection.DocumentCurrency = _Currency.Currency                                                        

{
  key cons.MaterialDocument,
  key cons.MaterialDocumentYear,
  key cons.MaterialDocumentItem,  
      cons.Plant,
      _Plant.PlantName,
      cons.Material,
      _Mat.MatName,
      cons.DocumentDate,
      cons.ConsignmentPipelineSupplier as Supplier,
      cons.ConsignmentPipelineSupplier as Vendor,
      @Semantics: { amount : {currencyCode: 'DocumentCurrency'} }
      cons.SuplrCsgnmtPplineWthdrwlAmount as Amount,
      @ObjectModel.foreignKey.association: '_Currency'
      cons.DocumentCurrency,
      @Semantics: { quantity : {unitOfMeasure: 'QtyUnit'} }
      cons.SuplrCsgnmtPplineWthdrwlQty as Quantity,      
      @ObjectModel.foreignKey.association: '_UoM'
      cons.SupCsgnmtPplineWthdrwlQtyUnit as QtyUnit,
      cons.DebitCreditCode as DCIndicator,
      cons.NonDeductibleInputTaxAmount as TaxAmount,
      _Currency,
      _UoM     
 
}
    
   
